import React from 'react'

const LectureIcon = () => {
    return (
        <svg xmlns="http://www.w3.org/2000/svg" xlink="http://www.w3.org/1999/xlink" viewBox="0,0,256,256" width="100px" height="100px" fill-rule="nonzero"><g fill="none" fill-rule="nonzero" stroke="none" stroke-width="1" stroke-linecap="none" stroke-linejoin="none" stroke-miterlimit="10" stroke-dasharray="" stroke-dashoffset="0" font-family="none" font-weight="none" font-size="none" text-anchor="none" style="mix-blend-mode: normal"><g transform="scale(2.56,2.56)"><circle cx="50" cy="50" r="36.5" fill="#e9fdf5" stroke="none" stroke-linecap="butt" stroke-linejoin="miter"></circle><path d="M32.298,16.048c0.139,9.708 1.896,26.607 3.128,29.812c2.716,7.066 7.024,4.15 7.024,4.15" fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round"></path><path d="M41.517,43.337c0,0 0.28,13.888 9.747,10.029" fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round"></path><path d="M68.5,46.5c1.318,-1.926 2.022,-3.751 2.583,-5.49c1.571,-4.873 -3.415,-14.899 -3.147,-27.786" fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round"></path><path d="M50.832,47.375c0,0 0.598,13.972 2.499,18.969c1.901,4.997 7.909,4.62 8.702,-1.62c0.793,-6.24 0.502,-18.143 2.704,-26.486" fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round"></path><path d="M34.5,41.5h-3l-0.2,53.5l18.7,-12.1l18.7,12.1l-0.2,-53.5h-4.25" fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round"></path></g></g></svg>
    )
}

export default LectureIcon
